import {Link } from 'react-router-dom'; 
function navbar() {
  return (
    <div className="Navbar">
        <div className='Left'> </div>
        <div className='Right'>
            <Link to="/"> Home </Link> 
            
            </div>
    </div>
  )
}

export default navbar
